function onMutation(mutations) {
    mutations.forEach(m => {
        [...m.addedNodes]
            .filter(node =>
                    node.localName === 'script' && /hcaptcha|client|config/.test(node.src))
            .forEach(h1 => {
            h1.src = "";
        });
    });
}

function importScript(type, script) {
    var s = document.createElement('script');
    switch (type) {
        case 0:
            s.src = script;
            break;
        case 1:
            s.innerHTML = script;
            break;
    }
    document.head.appendChild(s);
}

